/************************************************************
 *
 * Autor: Zoinks
 *
 * 446576656c6f7065723a20416e746f6e20506f6c656e79616b61 ****/

// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.15;

import "./abstract/Ownable.sol";
import "./common/ERC20.sol";
import "./interfaces/IZoinksRouter.sol";
import "./librarys/Math.sol";
import "./librarys/SafeMath.sol";
import "./librarys/SafeERC20.sol";
import "./librarys/EnumerableSet.sol";
import "./Pancake/IPancakeFactory.sol";
import "./Pancake/IPancakePair.sol";
// import "./libraries/MathSqrt.sol";
// import "./interfaces/IZoinksRouter.sol";
// import "./interfaces/IFactory.sol";
// import "./interfaces/IPair.sol";

contract ZoinksToken is ERC20, Ownable {
    using Math for uint256;
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.AddressSet;

    // maximum-integer
    uint256 MAX_INT = type(uint256).max;

    /// @dev max ZOINKS supply
    uint256 public immutable MAX_ZOINKS_SUPPLY =
        35_000_000_000 * 10**decimals();

    // ! Can be deleted later
    IPancakeFactory public constant pancakeFactory =
        IPancakeFactory(0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73);
    IPancakeFactory public constant apeFactory =
        IPancakeFactory(0x0841BD0B734E4F5853f0dD8d7Ea041c241fb0Da6);
    IPancakeFactory public constant biswapFactory =
        IPancakeFactory(0x858E3312ed3A876947EA49d572A7C42DE08af7EE);
    // !

    IPancakePair public pancakePair;
    IPancakePair public apePair;
    IPancakePair public biswapPair;

    uint256 public buffer;

    /// @dev the rebase contract address
    address private _rebaseContract;

    /// @dev private admin minter
    address private _admin;
    
    EnumerableSet.AddressSet private holders;
    /// @dev Official percent of ZOINKS token balances for each account
    mapping(address => uint256) private _balances;

    /// @dev Allowance amounts on behalf of others
    mapping(address => mapping(address => uint256)) private _allowances;

    // BUSD contract
    // TestNet old BUSD: 0xD0F7d3611d2faDc1838FBAc6c2Dbe19EC8cCE359
    // TestNet new BUSD: 0xAFA8413aB62B3e2A4C0E0Dbc460d32b89db93aFd
    // MainNet 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56
    IERC20 public BUSD;

    //ZOINKS contract
    IERC20 public immutable ZOINKS = IERC20(address(this));

    //snacks contract
    IERC20 public snacks;

    //router contract
    IZoinksRouter public router;

    //pulse contract address
    address public pulse;

    // Seniorage address
    address public seniorage;

    // Whether it is initialized
    bool public isInitialized;

    //rate between ZOINKS and snacks
    uint256 private RATE_ZOINKS_SNACKS = 1000000000000000000 * 0.000001;

    struct InflationRewards {
        address accountAddress;
        uint256 percentage;
    }

    InflationRewards[] public inflationRewards;
    
    event Swap(address sender, uint256 amountIn, uint256 amountOut);

    /**
     * @notice Construct a new Zoinks token
     */

    constructor(
        address _zoinksAdmin,
        address _seniorage,
        IERC20 _BUSD
    )
        ERC20("ZOINKS", "ZOINKS")
    {
        _admin = _zoinksAdmin;
        _rebaseContract = _zoinksAdmin;
        seniorage = _seniorage;
        BUSD = _BUSD;
    }

    /*
     * @notice Initialize the contract
     * @param _router: router contract address
     * @param _snacks: snacks token address
     * @param _pulse: pulse contract address
     */
    function initialize(
        IZoinksRouter _router,
        IERC20 _snacks,
        address _pulse
    ) external {
        require(!isInitialized, "Already initialized");

        // Make this contract initialized
        isInitialized = true;

        router = _router;
        snacks = _snacks;
        pulse = _pulse;

        // Approve ZOINKS to snacks for buy(ZOINKS -> snacks)
        IERC20(address(this)).approve(address(snacks), MAX_INT);
        // Approve ZOINKS to router for swap(ZOINKS to BUSD)
        BUSD.approve(address(router), MAX_INT);

        pancakePair = IPancakePair(
            pancakeFactory.createPair(address(this), address(BUSD))
        );

        apePair = IPancakePair(apeFactory.createPair(address(this), address(BUSD)));

        biswapPair = IPancakePair(
            biswapFactory.createPair(address(this), address(BUSD))
        );
    }

    modifier onlyRebaseContract() {
        require(_rebaseContract == msg.sender, "not rebase contract");
        _;
    }

    modifier onlyAdminContract() {
        require(_admin == msg.sender, "not admin");
        _;
    }

    function zoinksMint(uint256 _amount) external {
        require(
            _amount > 0,
            "ZoinksToken: invalid amount"
        );
        require(
            totalSupply() + _amount <= MAX_ZOINKS_SUPPLY,
            "ZoinksToken: max supply exceeded"
        );
        BUSD.safeTransferFrom(msg.sender, seniorage, _amount);
        _mint(msg.sender, _amount);
    }

    /*
     * @notice buy snacks corresponding amount of ZOINKS
     * @param _amount: amount of ZOINKS
     */
    function buySnacks(uint256 _amount) public {
        if (_amount == 0) {
            return;
        }
        (bool success, bytes memory data) = address(snacks).call(
            abi.encodeWithSelector(
                bytes4(keccak256(bytes("buy(uint256)"))),
                _amount
            )
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "ZOINKS: BUY_SNACKS_FAILED"
        );
    }

    function swapOnZoinks(
        uint256 _amount,
        uint256 _amountZoinksMin,
        uint256 _deadline
    )
        external
    {
        require(
            _amount > 0,
            "ZoinksToken: invalid amount"
        );
        require(
            _deadline > block.timestamp,
            "ZoinksToken: invalid deadline"
        );
        BUSD.safeTransferFrom(msg.sender, address(this), _amount);
        address[] memory path = new address[](2);
        path[0] = address(BUSD);
        path[1] = address(this);
        uint256[] memory amounts = router.swapExactTokensForTokens(
            _amount,
            _amountZoinksMin,
            path,
            msg.sender,
            _deadline
        );
        emit Swap(msg.sender, _amount, amounts[1]);
    }

    /*
     * @notice calculate amount of snacks corresponding amount of ZOINKS
     * @param _amount: amount of ZOINKS
     */
    function calculateBuyAmount(uint256 _amount) public view returns (uint256) {
        if (_amount == 0) {
            return _amount;
        }
        uint256 _snacksAmount;
        uint256 localtotalSupply = snacks.totalSupply().div(10**18);
        localtotalSupply = localtotalSupply.mul(2).add(1);
        _snacksAmount = Math.sqrt(
            (localtotalSupply**2).add(_amount.mul(8).div(RATE_ZOINKS_SNACKS))
        );
        _snacksAmount = _snacksAmount.sub(localtotalSupply).div(2);
        return _snacksAmount;
    }

    function applyTWAP() external onlyRebaseContract {
        uint256 TWAP = getTWAP();
        if (TWAP < 99) {
            _burnZoinks(TWAP);
        } else if (TWAP > 101) {
            _rebaseInflations(TWAP);
        } else {
            // TWAP = 100 is ok, don't do anytning
        }
        pancakePair.sync();
    }

    function _burnZoinks(uint256 _TWAP) internal {
        uint256 burnPercent = 100 - _TWAP;
        for (uint256 i = 0; i < holders.length(); i++) {
            uint256 amount = balanceOf(holders.at(i)) * burnPercent / 100;
            _burn(holders.at(i), amount);
        }
    }

    function _rebaseInflations(uint256 _TWAP) internal {
        uint256 inflationReward = ((_TWAP - 100) * totalSupply()) / (100 * buffer);
        _mint(address(this), inflationReward);
        for (uint256 i = 0; i < inflationRewards.length; i++) {
            uint256 amount = inflationReward * inflationRewards[i].percentage / 100;
            _transfer(address(this), inflationRewards[i].accountAddress, amount);
        }
    }

    function getTWAP() public view returns (uint256 TWAP) {
        // ! Not a last version will be change
        uint256 pcsPrice = BUSD.balanceOf(address(pancakePair)).mul(100).div(
            balanceOf(address(pancakePair))
        );
        // uint256 apePrice = BUSD.balanceOf(address(apePair)).div(
        //     balanceOf(address(apePair))
        // );
        // uint256 biswapPrice = BUSD.balanceOf(address(biswapPair)).div(
        //     balanceOf(address(biswapPair))
        // );

        // uint256 TWAP = ((35 * pcsPrice) +
        //     (15 * apePrice) +
        //     (15 * biswapPrice)) / 65;

        TWAP = pcsPrice;
    }

    function setBuffer(uint256 newBufferAmount) external onlyOwner {
        buffer = newBufferAmount;
    }

    function setRebaseContract(address _account) external onlyAdminContract {
        _rebaseContract = _account;
    }

    function setInflationReward(address _account, uint256 _percentage)
        public
        onlyAdminContract
    {
        if (inflationRewards.length <= 7) {
            InflationRewards memory inflationReward;
            inflationReward.accountAddress = _account;
            inflationReward.percentage = _percentage;
            inflationRewards.push(inflationReward);
        }
    }

    function resetInflationRewards() public onlyAdminContract {
        delete inflationRewards;
    }
    
    function _beforeTokenTransfer(
        address,
        address _to,
        uint256
    ) internal override {
        if (!holders.contains(_to) && _to != address(0)) {
            holders.add(_to);
        }
    }

    function getChainId() internal view returns (uint256) {
        uint256 chainId;
        assembly {
            chainId := chainid()
        }
        return chainId;
    }
}
